__NUXT_JSONP__("/drugs/Plinabulin", (function(a){return {data:[{drug:{slug:a,emaEpar:[],fdaDrugLabel:[],id:a,nciThesaurus:{casRegistry:"714272-27-2",chebiId:"",chemicalFormula:"C19H20N4O2",definition:"An orally active diketopiperazine derivative with potential antineoplastic activity. Plinabulin selectively targets and binds to the colchicine-binding site of tubulin, thereby interrupting equilibrium of microtubule dynamics. This disrupts mitotic spindle assembly leading to cell cycle arrest at M phase and blockage of cell division. In addition, plinabulin may also inhibit growth of proliferating vascular endothelial cells, thereby disrupting the function of tumor vasculature that further contributes to a decrease in tumor cell proliferation.",fdaUniiCode:"986FY7F8XR",identifier:"C62444",preferredName:a,semanticType:"Organic Chemical",subclassOf:["C67421"],synonyms:["(3Z,6Z)-6-benzylidene-3-{[5-(1,1-dimethylethyl)-1H-imidazol-4-yl]methylidene}piperazine-2,5-dione","NPI-2358","PLINABULIN",a]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FPlinabulin",extension:".json",createdAt:"2021-10-30T13:42:03.423Z",updatedAt:"2021-10-30T13:42:03.433Z"}}],fetch:{},mutations:void 0}}("Plinabulin")));